import React, { useState, useCallback } from "react";
const App = () => {
  const [count, setCount] = useState(0);
  const increment = () => {
    console.log("setting count");
    setCount(count + 1);
    console.log(count);
  };

  return (
    <div>
      <div> Hello World</div>
      {console.log("rendering")}
      <br />
      <div>Increment</div>
      <br />
      <button
        onClick={useCallback(() => {
          increment();
        }, [count])}
      >
        {count}
      </button>
    </div>
  );
};

export default App;
